type Transaction = {
  sheetIndex: number;
  address: string;
  amount: bigint;
  timestamp: number;
}
type Result = {
  tgold: bigint;
  refund: bigint;
}

const genesisMintPrice = 40n; // ada
const tgoldPrice = 2n; // 2 ADA ~= $1 USD
const WHITELIST_END_TIMESTAMP = 1707494400000;
const MINT_SOLD_OUT = 1707605106000;
const MINT_END = 1708099200000; // the public ends after this time

function getMintInfo(transaction: Transaction): Result {
  let goldPacksBought = 0n; // one pack = $1 = 2560 TGOLD
  let shouldRefund = false; // refund people who tried to buy a Genesis Trainer too close to the mint end


  const userAda = transaction.amount; // fill in with how much the user sent
  const genesisSoldOut = transaction.timestamp > MINT_SOLD_OUT;
  if (!genesisSoldOut) {
    // if they bought a Genesis Trainer+ (comes with tgold)
    // otherwise, they just bought a free mint (does not comes with tgold)
    if (userAda >= genesisMintPrice) {
      goldPacksBought += (userAda - genesisMintPrice) / tgoldPrice;

      // give bonus $2 in tgold to whitelist participants that bought a Genesis Trainer
      if (transaction.timestamp < WHITELIST_END_TIMESTAMP) {
        goldPacksBought += 2n;
      }
    }
  } else {
    
    const fourHours = 4*60*60*1000;
    if (transaction.timestamp <= MINT_SOLD_OUT + fourHours && userAda >= genesisMintPrice) {
      shouldRefund = true;
      goldPacksBought += (userAda - genesisMintPrice) / tgoldPrice;
    } else {
      goldPacksBought += (userAda / tgoldPrice);
    }
  }
  return {
    tgold: goldPacksBought * 2560n,
    refund: shouldRefund ? genesisMintPrice : 0n
  };
}

const txs =
  rawTxs
    .split('\n')
    .filter(val => val !== "")
    .map(tx => tx.split("\t"))
    .map((parts, i) => ({
      sheetIndex: i + 2, // +1 because of the header in the sheet, +1 since it's 1-indexed
      timestamp: Number.parseInt(parts[0]) * 1000,
      address: parts[1],
      amount: BigInt(Math.floor(Number.parseInt(parts[2])))
    }));
console.log(txs);
const refunds: { address: string, amount: bigint, sheetIndex: number }[] = [];
const tgolds: { address: string, amount: bigint }[] = [];
for (const tx of txs) {
  const result = getMintInfo(tx);
  tgolds.push({ address: tx.address, amount: result.tgold });
  if (result.refund > 0) {
    refunds.push({ address: tx.address, amount: result.refund, sheetIndex: tx.sheetIndex });
  }
}
